// ==============================================================================================================================
// ==============================================================================================================================
$(document).ready(function(){
	    setTimeout(function() { $('body').animate({ 'opacity': '1' }); }, 200)
		$(".lazy").lazyload({effect:"fadeIn"});
		 // 
		if( $(".framepage").length==0 ) return;
	    $(".framepage").data("fastclick")!=0 && FastClick.attach(document.body)
		// 
		body_w = $(window).width();
		body_h = $(window).height();
		head_h = $(".framepage > .header").length >= 1 ? $(".framepage > .header").outerHeight() : 0 ;
		foot_h = $(".framepage > .footer").length >= 1 ? $(".framepage > .footer").outerHeight() : 0 ;
		tbar_h = $(".framepage > .topbar").length >= 1 ? $(".framepage > .topbar").outerHeight() : 0 ;
		$(".framepage").css({paddingTop:head_h+tbar_h,paddingBottom:foot_h});
		$(".framepage > .topbar").css({top:head_h});
		$(".framepage > .wrapper").css({minHeight:body_h-head_h-foot_h-tbar_h});
		$(".framepage > .wrapper > .container").css({minHeight:body_h-head_h-foot_h-tbar_h});
		$(".framepage").append("<div class='shadow'></div>")

        //
		$(".hd-menu").click(function(){
			$(".wrapper").toggleClass("menuShow")
			$(".topbar").toggleClass("menuShow")
			$(".hd-menu").toggleClass("menuShow")
			$("body").on('touchmove', function(e){
		 		   e.preventDefault();
		 	});
		})
		$(".container").click(function(){
            $(".wrapper").removeClass("menuShow")
            $(".topbar").removeClass("menuShow")
            $(".hd-menu").removeClass("menuShow")
            $("body").off('touchmove')
		})
		$(".topbar").click(function(){
            $(".wrapper").removeClass("menuShow")
            $(".topbar").removeClass("menuShow")
            $(".hd-menu").removeClass("menuShow")
            $("body").off('touchmove')
		})
		window.onpageshow = function(event){
	        if (event.persisted) {  
	            window.location.reload();
	        }
	    }
		
        $(".shadow,.shadowPanel").on('touchmove', function(e){
 		   e.preventDefault();
 		});
})

